import React from "react";

export const FlowerField = () => {
  return (
    <>
      <section id="flower-Background">
        <div>
          <h1>Everything what you wanna from flowers on PrzyGoDa</h1>
          <h2>
            Enjoy your taste of the nature treasure, take the bouquet of your
            life or choose a gift for your lover. Thats all you can find on this
            site.
          </h2>
        </div>
      </section>
    </>
  );
};

export default FlowerField;
